import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [config, setConfig] = useState({
    totalTickets: 0,
    releaseRate: 0,
    retrievalRate: 0,
    maxCapacity: 0,
  });

  const [isRunning, setIsRunning] = useState(false);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setConfig((prev) => ({ ...prev, [name]: value }));
  };

  const handleSave = () => {
    console.log("Configuration Saved:", config);
    alert("Configuration saved!");
  };

  const handleClose = () => {
    setConfig({ totalTickets: 0, releaseRate: 0, retrievalRate: 0, maxCapacity: 0 });
    alert("Configuration cleared!");
  };

  const handleStart = () => {
    setIsRunning(true);
    console.log("System started");
  };

  const handleStop = () => {
    setIsRunning(false);
    console.log("System stopped");
  };

  const handleReset = () => {
    setIsRunning(false);
    console.log("System reset");
  };

  return (
    <div className="app">
      <header className="header">
        <h1>Ticket Management System</h1>
      </header>

      <div className="main-content">
        {/* Configuration Box */}
        <div className="box config-box">
          <h2>Configuration Details</h2>
          <form>
            <label>
              Total Number of Tickets:
              <input
                type="number"
                name="totalTickets"
                value={config.totalTickets}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Ticket Release Rate:
              <input
                type="number"
                name="releaseRate"
                value={config.releaseRate}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Customer Retrieval Rate:
              <input
                type="number"
                name="retrievalRate"
                value={config.retrievalRate}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Maximum Ticket Capacity:
              <input
                type="number"
                name="maxCapacity"
                value={config.maxCapacity}
                onChange={handleInputChange}
              />
            </label>
            <div className="button-group">
              <button type="button" onClick={handleSave}>
                Save
              </button>
              <button type="button" onClick={handleClose}>
                Close
              </button>
            </div>
          </form>
        </div>

        {/* Ticket Pool Status */}
        <div className="box status-box">
          <h2>Ticket Pool Status</h2>
          <p>Available Tickets: {config.totalTickets}</p>
          <p>Release Rate: {config.releaseRate} tickets/sec</p>
          <p>Retrieval Rate: {config.retrievalRate} tickets/sec</p>
          <p>Max Capacity: {config.maxCapacity}</p>
        </div>

        {/* Control Panel */}
        <div className="box control-panel">
          <h2>Control Panel</h2>
          <button onClick={handleStart}>Start</button>
          <button onClick={handleStop}>Stop</button>
          <button onClick={handleReset}>Reset</button>
        </div>
      </div>

      <footer className="footer">
        <p>&copy; 2024 Ticket Management System</p>
      </footer>
    </div>
  );
};

export default App;
